function onOkPrefsClick() {
  const selectedFields = Array.from(document.querySelectorAll("#col_list .col_checkbox:checked"))
    .map(cb => cb.getAttribute("data-field"));

  // Use setColumnsVisible for each column
  columnDefs.forEach(col => {
    const isChecked = selectedFields.includes(col.field);
    agGridInstance.setColumnsVisible([col.field], isChecked);
  });

  hidePrefs();
}

